import React, {useEffect, useMemo, useState} from 'react';
import {
    Button,
    Card,
    CardContent,
    OutlinedInput,
    Icon,
    TextField,
    Typography,
    CardActions,
    Divider,
    Select,
    InputLabel,
    FormControl,
    MenuItem,
    LinearProgress
} from '@material-ui/core';
import {makeStyles, useTheme} from '@material-ui/styles';
import {FuseAnimate, FuseAnimateGroup} from '@fuse';
import PastOfferingCard from './PastOfferingCard';
import axiosInstance from 'app/main/axios';

const useStyles = makeStyles(theme => ({
    header    : {
        background: 'linear-gradient(to right, ' + theme.palette.primary.dark + ' 0%, ' + theme.palette.primary.main + ' 100%)',
        color     : theme.palette.getContrastText(theme.palette.primary.main)
    },
    headerIcon: {
        position     : 'absolute',
        top          : -64,
        left         : 0,
        opacity      : .04,
        fontSize     : 512,
        width        : 512,
        height       : 512,
        pointerEvents: 'none'
    }
}));

export default function PastOfferings(props)
{
    const [offerings,setOfferings]=React.useState(null);
    const classes=useStyles();
    useEffect(()=>{
        console.log(props.offeringId);
        console.log(props);
        axiosInstance.get('get-past-course-offerings/',{
            params:{
                offeringId:props?props.offeringId:1
            }
        }).then(response => {
            console.log(response.data);
            setOfferings(response.data);
        }).catch(err => {
            console.log(err);
        });
    },[props])
    return (
    <div className="flex flex-col flex-1 w-full">               
    <FuseAnimateGroup
        enter={{
            animation: "transition.slideUpBigIn"
        }}
        className="flex flex-wrap py-24"
    >
        {offerings?offerings.map((value)=> (
            <PastOfferingCard id={value.id} name={value.courseId__courseName} session={value.session} sem={value.sem} color='#6699FF' enrolments={55} teacherName={value.coordinatorId__name}> </PastOfferingCard> 
        )):null}
    </FuseAnimateGroup>

     </div>

);
}
